const App = () => {
  return (
    <main>
      {/*<NavBar />*/}
      {/*<Container>*/}
        <Routes>
          <Route path="*" element={<PageTitle>404 NOT FOUND</PageTitle>} />
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/favorite" element={<Favorite />} />
          <Route path="/list/:listId" element={<List />} />
        </Routes>
      {/*</Container>*/}
    </main>
  );
};
export default App;
